import React from 'react';

import './homepage.styles.scss';
import HomePageContainer from './homepage.styled';

import Directory from '../../components/directory/directory.component';

const Homepage = () => (
    <HomePageContainer>
        <Directory />
    </HomePageContainer>
)

export default Homepage;
